import React from 'react';

function Manage_customer() {
  return (
    <div>

      {/* TITLE */}
      <div className="container-fluid" style={{ padding: '40px 0', background: '#f8f9fa' }}>
        <div className="row">
          <div className="col-md-6 col-md-offset-3 text-center">
            <h1> Manage_customer</h1>
          </div>
        </div>
      </div>

      {/* TABLE */}
      <div className="container" style={{ padding: '40px 0' }}>
        <div className="row">
          <div className="col-md-10 col-md-offset-1">

            <table className="table table-hover">
              <thead>
                <tr>
                  <th>Id</th>
                  <th>Name</th>
                  <th>Image</th>
                  <th>Email</th>
                  <th className="text-center">Action</th>
                </tr>
              </thead>

              <tbody>
                <tr>
                  <td>1</td>
                  <td>Vijay</td>
                  <td><img src="https://www.w3schools.com/bootstrap5/img_avatar3.png" width="40" alt="" /></td>
                  <td>vijay@gmail.com</td>
                  <td className="text-center">
                    <button className="btn btn-danger btn-sm">Delete</button>{' '}
                    <button className="btn btn-primary btn-sm">Edit</button>
                  </td>
                </tr>

                <tr>
                  <td>2</td>
                  <td>Nidhi</td>
                  <td><img src="https://www.w3schools.com/bootstrap5/img_avatar5.png" width="40" alt="" /></td>
                  <td>nidhi@gmail.com</td>
                  <td className="text-center">
                    <button className="btn btn-danger btn-sm">Delete</button>{' '}
                    <button className="btn btn-primary btn-sm">Edit</button>
                  </td>
                </tr>

              </tbody>
            </table>

          </div>
        </div>
      </div>

    </div>
  );
}

export default Manage_customer;
